import { BrowserRouter,Route,Routes } from "react-router-dom";
import { Login } from "./component";

const RouterPage =()=>{
    return(
        <BrowserRouter>
        <Routes>
            <Route path="/Login" element={<Login/>}/>
            </Routes>
        </BrowserRouter>

    );
}
export default Router;
